        try {
            const res = await fetch('/userprofile', {
                method: "GET",
                headres: {
                    Accept: "application/json",
                    "Content-Type": "application/json"
                },
                credentials: "include"
            });
            const data = await res.json();
            console.log(data);
            setUserData(data);
